INSERT INTO `pengumuman` VALUES   ('9','eksternal','Jadwal Pelaksanaan USBK TP. 2021/2022','1','<p><strong>1. Sabtu, 9 April 2022</strong><br />Pendidikan Kewarganegaraan | Suhendri, SH</p>\r\n<p><strong>2. Ahad, 10 April 2022</strong><br />Bahasa Indonesia | Yayan Putra, S.Pd</p>\r\n<p><strong>3. Senin, 11 April 2022</strong><br />Bahasa Inggris |&nbsp;Mahmut Dianto, S.Pd</p>\r\n<p><strong>4. Selasa, 12 April 2022</strong><br />Matematika |&nbsp;Herjan Pandi Kusnadi, S.Pd</p>\r\n<p><strong>5. Rabu, 13 April 2022</strong><br />Ilmu Pengetahuan Alam |&nbsp;L. M. Rispan Sugi S., S.Pd</p>\r\n<p><strong>6. Kamis, 14 April 2022</strong><br />Ilmu Pengetahuan Sosial |&nbsp;Drs. Agus Samsul Afandi</p>\r\n<p><strong>7. Jumat, 15 April 2022</strong><br />Pendidikan Jasmani, olahraga dan kesehatan |&nbsp;Sandika, S.Pd</p>\r\n<p><strong>8. Sabtu, 16 April 2022</strong><br />Prakarya |&nbsp;Japarwadi, S.Pd</p>','2022-04-08 02:20:04');
INSERT INTO `pengumuman` VALUES ('15','eksternal','Tata Tertib Peserta Ujian','1','<p><span style=\"font-size: 12pt;\">1. Santri datang 5 menit sebelum ujian dilaksanakan&nbsp;</span><br /><span style=\"font-size: 12pt;\">2. Santri wajib menggunakan seragam dan sepatu</span><br /><span style=\"font-size: 12pt;\">3. Santri wajib membawa kartu ujian</span><br /><span style=\"font-size: 12pt;\">4. Santri dilarang ribut di ruang ujian</span><br /><span style=\"font-size: 12pt;\">5. Santri dilarang membuka apllikasi lain</span><br /><span style=\"font-size: 12pt;\">6. Santri yang melanggar aturan akan dikeluarkan dari ruang ujian&nbsp;</span></p>\r\n<p><a href=\"../cbt/jadwal\">Lihat ujian aktif</a></p>','2022-04-08 02:31:27');
