INSERT INTO `soal` VALUES ('374','11','36','<p>Bacalah kutipan teks tanggapan berikut dengan cermat!</p>\r\n<p>Saya siswa kelas 9 di SMPN 02 Masbagik.Kelas kami untuk sementara ada di bawah dekat dengan mushola dan kolam ikan di sampingnya.Susana yang tercipta sejuk sekali.Di dukung kebersihan yang tergambar dari kerapian tiap kelasnya.Kelas kami di cat warna hijau, semakin menguatkan suasan damai di sekitarnya. Pemandanagan akan sedikit terganggu jika melihat sudut belakang ruang kelas yang masih belum rapi.</p>\r\n<p>Struktur dari kutipan teks tanggapan tersebut adalah &hellip;</p>','1','<p>Deskripsi</p>','<p>Penilaian</p>','<p>Konteks</p>','<p>Penegasan ulang.</p>','','A','','','','','','','');
