INSERT INTO `soal` VALUES ('377','11','33','<p>Siswa sebaiknya mengubah kebiasaan tidak sarapan menjadi pola disiplin untuk sarapan.Kesiapan fisik siswa harus dijaga dalam keadaan baik. Fisik yang prima akan memberikan dampak yang baik bagi prestasi dalam belajar. Prestasi belajar yang cemerlang merupakan jalan untuk meraih kesuksesan.</p>\r\n<p>Dilihat dari isinya,jenis teks tanggapan tersebut adalah &hellip;.</p>','1','<p>Pujian</p>','<p>Sanggahan</p>','<p>&nbsp;Kritikan</p>','<p>Arahan/ saran</p>','','C','','','','','','','');
INSERT INTO `soal` VALUES ('378','11','32','<p>Siswa sebaiknya mengubah kebiasaan tidak sarapan menjadi pola disiplin untuk sarapan.Kesiapan fisik siswa harus dijaga dalam keadaan baik. Fisik yang prima akan memberikan dampak yang baik bagi prestasi dalam belajar. Prestasi belajar yang cemerlang merupakan jalan untuk meraih kesuksesan.</p>\r\n<p>Isi teks tanggapan tersebut adalah &hellip;</p>','1','<p>Mengajak siswa untuk belajar setiap pagi</p>','<p>Mengajak siswa untuk mengunjungi kantin di pagi hari</p>','<p>Memberikan informasi menu sarapan yang baik</p>','<p>Memberikan informasi pentingnya sarapan.</p>','','D','','','','','','','');
INSERT INTO `soal` VALUES ('379','11','31','<p>Fika berasal dari keluarga yang cukup harmonis. Anggota keluarganya terdiri dari ayah, ibu,fika dan adiknya fian. Sejak SMP Fika sudah bersekolah jauh dari orang tuanya, karena keterbatasan dana.&nbsp; Dia tinggal bersama bibinya di kota lain.</p>\r\n<p>Tidak terasa tiga tahun sudah berlalu,keinginan Fika untuk melanjutkan sekolah di dekat rumah orang tuanya semakin kuat. Kerinduan untuk berkumpul sering sekali mengganggu pikirannya.Tidak jarang diam-diam dia menangis sendiri.Fika pun menyampaikan keinginannya itu kepada orang tuanya.</p>\r\n<p>Yang menunjukkan deskripsi suasana pada kutipan cerpen tersebut adalah &hellip;.</p>','1','<p>Keinginan Fika untuk melanjutkan sekolah di dekat rumahnya</p>','<p>Tidak jarang diam-diam dia menangis sendiri</p>','<p>Tidak terasa tiga tahun sudah berlalu</p>','<p>Fika menyampaikan keinginannya kepada orang tuanya</p>','','B','','','','','','','');
INSERT INTO `soal` VALUES ('380','11','30','<p>Fika berasal dari keluarga yang cukup harmonis. Anggota keluarganya terdiri dari ayah, ibu,fika dan adiknya fian. Sejak SMP Fika sudah bersekolah jauh dari orang tuanya, karena keterbatasan dana.&nbsp; Dia tinggal bersama bibinya di kota lain.</p>\r\n<p>Tidak terasa tiga tahun sudah berlalu,keinginan Fika untuk melanjutkan sekolah di dekat rumah orang tuanya semakin kuat. Kerinduan untuk berkumpul sering sekali mengganggu pikirannya.Tidak jarang diam-diam dia menangis sendiri.Fika pun menyampaikan keinginannya itu kepada orang tuanya.</p>\r\n<p>Deskripsi waktu pada kutipan cerpen tersebut adalah &hellip;</p>','1','<p>tiga tahun sudah berlalu</p>','<p>Keluarga harmonis</p>','<p>keinginan Fika</p>','<p>Keterbatasan dana</p>','','A','','','','','','','');
INSERT INTO `soal` VALUES ('381','11','29','<p>Fika berasal dari keluarga yang cukup harmonis. Anggota keluarganya terdiri dari ayah, ibu,fika dan adiknya fian. Sejak SMP Fika sudah bersekolah jauh dari orang tuanya, karena keterbatasan dana.&nbsp; Dia tinggal bersama bibinya di kota lain.</p>\r\n<p>Tidak terasa tiga tahun sudah berlalu,keinginan Fika untuk melanjutkan sekolah di dekat rumah orang tuanya semakin kuat. Kerinduan untuk berkumpul sering sekali mengganggu pikirannya.Tidak jarang diam-diam dia menangis sendiri.Fika pun menyampaikan keinginannya itu kepada orang tuanya.</p>\r\n<p>Yang menunjukkan deskripsi tempat pada kutipan cerpen tersebut adalah &hellip;.</p>','1','<p>Fika tinggal bersama bibinya di kota lain.</p>','<p>Fika menyampaikan keinginanya untuk pindah sekolah</p>','<p>Anggota keluarganya terdiri dari ayah, ibu dan adiknya Fian</p>','<p>Fika berasal dari keluarga yang harmonis</p>','','A','','','','','','','');
INSERT INTO `soal` VALUES ('382','11','28','<p>Bacalah kutipan cerpen berikut !</p>\r\n<p>Fika berasal dari keluarga yang cukup harmonis. Anggota keluarganya terdiri dari ayah, ibu,fika dan adiknya fian. Sejak SMP Fika sudah bersekolah jauh dari orang tuanya, karena keterbatasan dana.&nbsp; Dia tinggal bersama bibinya di kota lain.</p>\r\n<p>Kata ganti yang digunakan pada kutipan teks cerpen tersebut adalah &hellip;</p>','1','<p>Beliau , Dia</p>','<p>Fika , Aku</p>','<p>Aku , Ia</p>','<p>Dia , Fika</p>','','D','','','','','','','');
INSERT INTO `soal` VALUES ('383','11','27','<p>1). Permintaan itu dikabulkan ibunya, tetapi ayahnya sedikit keberatan. &ldquo; Kenapa mau pindah sekolah? Apakah ada masalah&nbsp; di sekolahmu?&rdquo; Tanya ayah.&ldquo; Tidak, ayah, hanya ingin cari pengalaman baru saja,&rdquo; jawab Fika. : Lalu bagaimana dengan bibimu, apakah dia setuju dengan keinginanmu itu?&rdquo; Tanya ayah.Dengan berat hati Fika menjawab.&rdquo;Aku belum bicara pada bibi, tapi pasti aku akan memberitahunya&rdquo;.</p>\r\n<p>2). Beberapa hari setelah pembicaraan dengan orang tuanya, Fika mendengar kabar bahwa SMA yang dekat rumah orang tuanya mengadakan lomba pidato dan pemenangnya akan diterima di sekolah tersebut serta mendapatkan beasiswa. Fika pun mengikuti lomba pidato itu.Akhirnya dia menjadi pemenang, fika pun memberitahukan kabar gembira itu kepada orang tua dan bibinya.</p>\r\n<p>3). Ketika masuk tahun ajaran baru, Fika pun bisa kembali berkumpul bersama keluarganya. Walaupun makan seadanya dengan lauk yang sangat sederhana akan terasa nikmat bila berkumpul bersama keluarga. Hal itu juga bisa mengobati rasa rindu Fika selama ini.</p>\r\n<p>Pesan yang terdapat pada kutipan cerpen tersebut adalah &hellip;.</p>','1','<p>Rajin belajar untuk meraih cita-cita</p>','<p>Rajin mengikuti lomba pidato untuk menjadi juara</p>','<p>Bersyukurlah ketika menjadi pemenang lomba pidato</p>','<p>Jangan menyerah dengan keadaan karena setiap masalah pasti ada jalan keluar.</p>','','D','','','','','','','');
