INSERT INTO `soal` VALUES ('390','11','20','<p><em>Bacalah kutipan pidato berikut</em> !</p>\r\n<p><em>Assalamualaikum Warahmatullahi Wabarakatuh</em></p>\r\n<p>Salam sejahtera untuk kita semua</p>\r\n<p>Bapak Kepala Sekolah serta Bapak dan Ibu guru yang saya hormati, serta rekan-rekan yang berbahagia.</p>\r\n<p>&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;&hellip;.</p>\r\n<p>Kalimat yang tepat untuk melengkapi teks pidato tersebut adalah &hellip;</p>','1','<p>Pertama-tama marilah kita panjatkan puji syukur kehadirat Allah SWT</p>','<p>Pertama-tama saya memohon maaf bila ada kesalahan dalam pidato saya</p>','<p>Dalam kesempatan ini perkenankan saya mewakili teman-teman</p>','<p>Dalam kesempatan ini saya akan menyampaikan pidato tentang &ldquo; kejujuran&rdquo;</p>','','A','','','','','','','');
INSERT INTO `soal` VALUES ('391','11','11','<p style=\"text-align: justify;\">Bacalah teks pidato persuasif berikut.</p>\r\n<p style=\"text-align: justify;\">Assalamualaikum warahmatullah iwabarakatuh&hellip;</p>\r\n<p style=\"text-align: justify;\">Bapak dan ibu yang saya hormati serta teman-teman yang berbahagia. Puji syukur kita panjatkan pada&nbsp; ALLAH SWT yang telah memberi rahmat dan hidayah-Nya pada kita semua, sehingga kita dapat merasakan nikmat-Nya yang begitu banyak. Bapak dan ibu serta teman-teman yang saya hrmati, dalam kesempatan ini saya akan menyampaikan pidato tentang wabah virus&nbsp; corona yang sedang terjadi saat ini.</p>\r\n<p style=\"text-align: justify;\">Virus Corona ini pertama kali ditemukan di kota Wuhan &ndash; Cina .walau pun tergolong baru, virus ini sudah memakan banyak korban, oleh karena itu virus ini tidak bisa kita anggap remeh. Untuk itu sadarlah&hellip;.sadarlah bahwa virus ini sangat berbahaya. Gejala ketika orang terkena virus ini adalah batuk, demam, sesak,seluruh persendian nyeri, namun ada juga yang tanpa gejala. Pleh karena&nbsp; itu mari kita jaga kesehatan tubuh kita dengan pola hidup sehat agar memiliki imun tubuh yang kuat. Mencuci tangan dengan benar, jaga jarak dengan menghindari kerumunan, pakai masker merupakan upaya untuk pencegahan selain olah raga teratur dan asupan vitamin yang cukup.</p>\r\n<p style=\"text-align: justify;\">Demikianlah pidato yang dapat saya sampaikan. Intinya adalah marilah kita jaga kesehatan masing-masing,tetap semangat, jangan putus asa karena setiap masalah pasti ada jalan keluarnya. Terimakasih atas perhatian bapak/ibu dan teman-teman, mohon maaf jika ada tutur kata yang kurang berkenan.</p>\r\n<p style=\"text-align: justify;\">Wassalamualaikum Warahmatullahi Wabarakatuh</p>\r\n<p style=\"text-align: justify;\">Sapaan hormat dari teks pidato persuasif tersebut adalah &hellip;</p>','1','<p>Puji syukur kita panjatkan pada ALLAH SWT yang telah memberikan rahmat dan hidayahNya pada kita semua.</p>','<p>Bapak dan ibu yang saya hormati serta teman-teman yang berbahagia</p>','<p>Saya akan menyampaikan pidato tentang wabah virus corona</p>','<p>Mohon maaf jika ada tutur kata yang kurang berkenan</p>','','B','','','','','','','');
