INSERT INTO `soal` VALUES ('395','11','15','<p style=\"text-align: justify;\">Virus Corona ini pertama kali ditemukan di kota Wuhan &ndash; Cina(1). Walau pun tergolong baru, virus ini sudah memakan banyak korban, oleh karena itu virus ini tidak bisa kita anggap remeh(2). Untuk&nbsp; itu sadarlah&hellip;.sadarlah bahwa virus ini sangat berbahaya(3). Gejala ketika orang terkena virus ini adalah batuk, demam, sesak,seluruh persendian nyeri, namun ada juga yang tanpa gejala(4). Oleh karena itu mari kita jaga kesehatan tubuh kita dengan pola hidup sehat agar memiliki imun tubuh yang kuat(5). Mencuci tangan dengan benar, jaga jarak dengan menghindari kerumunan, pakai masker merupakan upaya untuk pencegahan selain olah raga teratur dan asupan vitamin yang cukup(6).</p>\r\n<p style=\"text-align: justify;\">Struktur dari kutipan teks pidato persuasif tersebut merupakan bagian &hellip;.</p>','1','<p>Pembuka&nbsp;</p>','<p>Isi&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>','<p>Penutup&nbsp;&nbsp;&nbsp;</p>','<p>Kesimpulan</p>','','B','','','','','','','');
